          (object) => {
            object.traverse(function(child) {
              if (child.isMesh) {
                child.castShadow = true;
                child.receiveShadow = true;
              }
            });

    const animate = () => {
      requestAnimationFrame(animate);
      renderer.render(scene, camera);
    };

    const playAnimation = (currentModel, nextModel) => {
      currentModel.visible = false;
      nextModel.visible = true;
      const mixer = new THREE.AnimationMixer(nextModel);
      const action = mixer.clipAction(nextModel.animations[0]);
      action.play();
      const clock = new THREE.Clock();

      const update = () => {
        requestAnimationFrame(update);
        const delta = clock.getDelta();
        mixer.update(delta);

        if (action.time >= action.getClip().duration) {
          nextModel.visible = false;
          currentModel.visible = true;
          return;
        }
      };
      update();
    };

    // Load Adobe Animate content
    const animationContainer = document.getElementById('animationContainer');
    animationContainer.innerHTML = '<canvas id="canvas"></canvas>';
    const script = document.createElement('script');
    script.src = 'animation.js'; // Ensure this path is correct
    document.body.appendChild(script);

    // Event listeners for Adobe Animate buttons
